import React, { useState } from 'react';
import catAnimation from '../assets/cat.json';
import Lottie from 'lottie-react';

const Category = () => {
    const [hovered, setHovered] = useState(false);

    return (
        <div>
            <div className="flex bg-[#020917] items-top ml-20">
                <div className="mb-6">
                    <Lottie animationData={catAnimation} style={{ width: '150px', height: '150px' }} />
                </div>
                <div className='pt-10'>
                    <h2 className="text-3xl text-white font-bold">Choose Category</h2>
                    <p className="text-gray-600 text-lg">Select a category from the options below.</p>
                </div>
            </div>
            <div className='pl-20'>
                <div className="flex justify-between mx-20 space-x-8">
                    <div className={`w-56 h-56 border border-gray-300 rounded-lg shadow-md p-4 ${hovered ? 'bg-white' : ''}`} onMouseEnter={() => setHovered(true)} onMouseLeave={() => setHovered(false)}>
                        {hovered && (
                            <button className="absolute inset-0 flex items-center justify-center w-full h-full bg-transparent text-white font-semibold cursor-pointer hover:bg-gray-200 hover:text-gray-800">
                                Play
                            </button>
                        )}
                        Category 1
                    </div>
                    <div className={`w-56 h-56 border border-gray-300 rounded-lg shadow-md p-4 ${hovered ? 'bg-white' : ''}`} onMouseEnter={() => setHovered(true)} onMouseLeave={() => setHovered(false)}>
                        {hovered && (
                            <button className="absolute inset-0 flex items-center justify-center w-full h-full bg-transparent text-white font-semibold cursor-pointer hover:bg-gray-200 hover:text-gray-800">
                                Play
                            </button>
                        )}
                        Category 2
                    </div>
                </div>
                <div className="flex justify-between mx-20 mt-4 space-x-8">
                    <div className={`w-56 h-56 border border-gray-300 rounded-lg shadow-md p-4 ${hovered ? 'bg-white' : ''}`} onMouseEnter={() => setHovered(true)} onMouseLeave={() => setHovered(false)}>
                        {hovered && (
                            <button className="absolute inset-0 flex items-center justify-center w-full h-full bg-transparent text-white font-semibold cursor-pointer hover:bg-gray-200 hover:text-gray-800">
                                Play
                            </button>
                        )}
                        Category 3
                    </div>
                    <div className={`w-56 h-56 border border-gray-300 rounded-lg shadow-md p-4 ${hovered ? 'bg-white' : ''}`} onMouseEnter={() => setHovered(true)} onMouseLeave={() => setHovered(false)}>
                        {hovered && (
                            <button className="absolute inset-0 flex items-center justify-center w-full h-full bg-transparent text-white font-semibold cursor-pointer hover:bg-gray-200 hover:text-gray-800">
                                Play
                            </button>
                        )}
                        Category 4
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Category;
